import { Marker, Popup } from 'react-leaflet';
import './MarkerPoint.css'

function MarkerPoint(props) {


  const latlng = [props.lat, props.lng]


  return (
    <Marker position={latlng} id={props.id} id="marker">
        <Popup maxWidth="100%">
          <h1>{props.date}</h1>
          <img src={"http://localhost:3001/api/v1/image/" + props.filename} alt="sick pic" class="marker-picture" />
          <p>{props.notes}</p>
        </Popup>
    </Marker>
  );
}

export default MarkerPoint;
